import React from "react";
import PopularRestaurant from "./PopularRestaurant";

const PopularRestaurants: React.FC<Popular> = ({restaurantName, chefName}: Budget) => {
  return (
    <div>
      <p>THE POPULAR RESTAURANTS IN EPICURE : </p>
      <p>{chefName}</p>
      <p>{chefName}</p>
    </div>
  );
};


const BudgetItem: React.FC<Budget> = ({category, budgeted, spent}: Budget) => {
  const remainingAmount: number = (budgeted - spent) > 0 ? (budgeted - spent) : 0;
  return <tr>
      <td>
          <h5>{category}</h5>
      </td>
      <td>
          <h5>{"$" + budgeted}</h5>
      </td>
      <td>
          <h5>{"$" + spent}</h5>
      </td>
      <td>
          <h5>{"$" + remainingAmount}</h5>
      </td>
  </tr>
}

export default PopularRestaurants;
